import React, {useState} from 'react';
import ExpenseFilter from './ExpenseFilter';
import ExpenseItem from './ExpenseItem';
import Card from '../UI/Card';
import './Expenses.css';

const Expenses = (props) => {
  const [selectedFilter, setChangeFilter]= useState('');

  const onChangeFilter=(yearSelected)=>{
    setChangeFilter(yearSelected);
    console.log(yearSelected);
  }

  return (
    <Card className="expenses">
      <ExpenseFilter selected={selectedFilter} onChange={onChangeFilter}/>
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
      date={props[0].date}/>
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      />
      <ExpenseItem
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      />
      <ExpenseItem
        title={props[3].title}
        amount={props[3].amount}
        date={props[3].date}
      /> 
    </Card>
  );
}

export default Expenses;
